import { CCol, CRow } from "@coreui/react";
import { Form } from "react-bootstrap";
import CButton from "src/Components/UI/Button/Button";
import Card from "src/Components/UI/Card/Card";
import FormInputLabel from "src/Components/UI/Input/FormInputLabel";
import useFormValidate from "src/Hooks/input-validation";
const ContactInfo = (props) => {
  const data = props.body;
  const {
    inputValue: jobTi,
    setInputValue: setAuthorName,
    inputChangeHandler: authorNameChangeHandler,
    inputBlurHandler: authorNameBlurHandler,
  } = useFormValidate();
  console.log(data);
  return (
    <Card color="primary" header="Contact Information">
      <Form>
        <CRow>
          <FormInputLabel
            label="Phone Number"
            type="text"
            readOnly={false}
            md={12}
            sm={12}
          />
        </CRow>
        <CRow>
          <FormInputLabel
            label="City"
            type="text"
            readOnly={false}
            md={6}
            sm={12}
          />
          <FormInputLabel
            label="Country"
            type="text"
            readOnly={false}
            md={6}
            sm={12}
          />
        </CRow>
        <CRow>
          <CCol md={12} sm={12} className="text-right">
            <CButton
              color="success"
              width="30%"
              type="submit"
              loading={false}
              name="update"
            />
          </CCol>
        </CRow>
      </Form>
    </Card>
  );
};
export default ContactInfo;
